import React from "react";
import Image from "../public/wine.jpg";

const imageStyle = {
  // width: 1000,
  // height: 600,
  marginLeft: "auto",
  marginRight: "auto",
};

function TopImage() {
  return (
    <div style={imageStyle}>
      <img src={Image} alt="ワインの写真" />
    </div>
  );
}

export default TopImage;
